import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';
import './AdminManager.css';
import logo from './logo.png';
class AdminManager extends Component {
    constructor(props){
        super(props);
        const token = localStorage.getItem("token");

        let loggedIn = true
        if(token == null){
            loggedIn = false
        }
        this.state = {
            loggedIn
        }
    }

    logout(e){
        e.preventDefault();
        localStorage.removeItem('token');
        return <Link to="/"/>
    }
    render() {
        if(this.state.loggedIn ===false){
            return <Redirect to="/"/>
        }
        return (
            <div>
                <div>
                    <form>
                        <button className="logout" type="submit" onClick={this.logout}>Logout</button>
                    </form>
                </div>
                <div>
                    <img src={logo} alt=""/>
                    <h1 style={{color:'white'}}>ADMINISTRATOR</h1>
                </div>

                <div className="bt">
                    <button type="submit" className="btn btn-primary btn-block btn-large">Company registration</button>
                    <button type="submit" className="btn btn-primary btn-block btn-large">Company list</button>
                </div>


            </div>
        );
    }
}

export default AdminManager;
